import { mouthTypes } from './mouth'
import { eyeTypes } from './eyes'
import { eyebrowTypes } from './eyebrows'
import { clothesType } from './clothes'
import { topTypes } from './top'
import { accessoriesTypes } from './accessories'
import { facialHairTypes } from './facial-hair'


export default {
     props: {
        random: {
            type: Boolean,
            default: true
        },
         circleColor: {
            type: String,
             default: '#6fb8e0'
        },
        identifier: { type: String, default: '' },
        topType: { type: String, default: '' },
        accessoriesType: { type: String, default: '' },
        facialHairType: { type: String, default: '' },
        clotheType: { type: String, default: '' },
        eyeType: { type: String, default: '' },
        eyebrowType: { type: String, default: '' },
        mouthType: { type: String, default: '' },
        skinColor: { type: String, default: '' },
     },
    methods: {
      getRandomChoice (items) {
          const itemsLength = Object.entries(items).length
          return Object.entries(items)[Math.floor((Math.random()*(itemsLength)))][1]
      }
    },
    data () {
        return {
            mouthTypes: mouthTypes,
            eyeTypes: eyeTypes,
            topTypes: topTypes,
            clothesType: clothesType,
            eyebrowTypes: eyebrowTypes,
            facialHairTypes: facialHairTypes,
            accessoriesTypes: accessoriesTypes,
            hatColors: {
                Black: "#262E33",
                Blue01: "#65C9FF",
                Blue02: "#5199E4",
                Blue03: "#25557C",
                Gray01: "#E6E6E6",
                Gray02: "#929598",
                Heather: "#3C4F5C",
                PastelBlue: "#B1E2FF",
                PastelGreen: "#A7FFC4",
                PastelOrange: "#FFDEB5",
                PastelRed: "#FFAFB9",
                PastelYellow: "#FFFFB1",
                Pink: "#FF488E",
                Red: "#FF5C5C",
                White: "#FFFFFF"
            },
            hairColors: {
                Auburn: "#A55728",
                Black: "#2C1B18",
                Blonde: "#B58143",
                BlondeGolden: "#D6B370",
                Brown: "#724133",
                BrownDark: "#4A312C",
                PastelPink: "#F59797",
                Platinum: "#ECDCBF",
                Red: "#C93305",
                SilverGray: "#E8E1E1"
            },
            skinColors: {
                Tanned: "#FD9841",
                Yellow: "#F8D25C",
                Pale: "#FFDBB4",
                Light: "#EDB98A",
                Brown: "#D08B5B",
                DarkBrown: "#AE5D29",
                Black: "#614335"
            }
        }
    },
    computed: {
        cssVars () {
          return {
            '--avataaar-hair-color': this.getRandomChoice(this.hairColors),
            '--avataaar-facial-hair-color': this.getRandomChoice(this.hairColors),
            '--avataaar-hat-color': this.getRandomChoice(this.hatColors)

          }
        }
    }
}
